The Card Game

Sociopolitical Documentary hosted by Lowell Bergman, published by PBS broadcasted as part of PBS Frontline series in 2009 - English narration


Information
------------------------------

As credit card companies face rising public anger, new regulation from Washington and a potential perfect storm of economic bad news, FRONTLINE correspondent Lowell Bergman examines the future of the massive consumer loan industry and its impact on a fragile national economy. 
In The Card Game, a follow-up to the Secret History of the Credit Card and a joint project with The New York Times, Bergman and the Times talk to industry insiders, lobbyists, politicians and consumer advocates as they square off over attempts to reform the way the industry has done business for decades.
It took the economic collapse in the fall of 2008 to set the stage for potentially historic change in the consumer credit business. President Obama and his team pushed through a credit card reform bill in May, and they're now looking to establish a new Consumer Finance Protection Agency. How are the credit, debit and pre-paid card industries repositioning themselves to maintain high profits under the new rules?

